// images references in the manifest
import "../../assets/icon-16.png";
import "../../assets/icon-32.png";
import "../../assets/icon-80.png";

/* global console, document, Office */

Office.onReady(info => {
    if (info.host === Office.HostType.PowerPoint) {
        document.getElementById("sideload-msg").style.display = "none";
        document.getElementById("app-body").style.display = "flex";
        document.getElementById("run").onclick = run;
    }
});

export async function run() {
    PowerPoint.run(context => {
        context.presentation.insertSlidesFromBase64(base64, {formatting: PowerPoint.InsertSlideFormatting.useDestinationTheme});
        const info = document.getElementById('info');
        info.innerHTML = "Before sync";
        const p = context.sync();
        info.innerHTML = "Sync started - Promise not resolved";
        return p.then(() => {
          console.log('resolved');
          document.getElementById('info').innerHTML = "Promise resolved!";
        });
    });

}

const base64 = ""